import React from "react";

const DisplayPosts = ({ postList }) => {
  async function createNewPost(obj) {
    await AxiosPosts.updatePosts(obj);
    return obj;
  }
  return (
    <div>
      {postList.map((post) => {
        return <div>{post.body}</div>;
      })}
    </div>
  );
};

export default DisplayPosts;
